import http from "./http-common";

function UsersLogged(token){
    return http
        .post("/getnumberofuserslogged/", {
            token,
        })
        .then(response => {
            return response;
        })
        .catch(error => console.log(error));
}

const usersLogged = {
    UserLogged,
};

export default usersLogged;
